// import PropTypes from 'prop-types';
import {useLocation} from 'react-router-dom';
import img from './img/not_found.png';
import styles from './NotFondPage.module.css';

const NotFondPage = () => {
    let location = useLocation();
    return (
        <>
            Not found
            <img style="height: 222px; width: 222px;" className="" src={img} alt="not_found"/>
            <p>No match for {location.pathname}</p>
        </>
    );
}

// NotFondPage.propTypes = {
//     : PropTypes.
// }

export default NotFondPage;
